window.addEventListener('message', function(event) {
    if (event.data.type === 'updateInventoryPath') {
      document.querySelectorAll('img').forEach((img) => {
        if (img.src.includes('nui://ox_inventory/web/images')) {
          img.src = img.src.replace('ox_inventory/web/images', event.data.payload);
        }
      });
    }
  });
  